create table symptom_expertises
(
    id              int auto_increment
        primary key,
    symptom_id      int             not null,
    expertise_id    int             not null,
    relevance_score float default 0 not null comment '相关性分数(0-1)',
    constraint uk_symptom_expertise
        unique (symptom_id, expertise_id),
    constraint fk_se_expertise
        foreign key (expertise_id) references expertises (expertise_id)
            on update cascade on delete cascade,
    constraint fk_se_symptom
        foreign key (symptom_id) references symptoms (symptom_id)
            on update cascade on delete cascade
);

